import { Box } from '@mui/material'
import React from 'react'

const HomePage = () => {
  return (
    <Box width={'100%'} height="100%" margin="auto" marginTop={2}>
        <Box margin={"auto"} width={'80%'} height={"40%"} padding={2}>
            <img src='https://www.google.com/url?sa=i&url=https%3A%2F%2Fwww.indiatoday.in%2Fmovies%2Fbollywood%2Fstory%2Fajay-devgn-r-madhavan-jyotika-shaitaan-to-stream-on-netflix-may-4-2534918-2024-05-03&psig=AOvVaw0JOl_Lir8hAE31mP3_NZUp&ust=1715690131329000&source=images&cd=vfe&opi=89978449&ved=0CBAQjRxqFwoTCOjLxvjRioYDFQAAAAAdAAAAABAJ' alt='Shaitaan'/>
        </Box>
    </Box>
  );
};

export default HomePage
